import { useEffect } from 'react';

function SortMovie({ movies }) {
    const getYears = movies.map((movie) => movie.releaseYear);
    const filterYears = getYears.filter(function(item, pos) {
        return getYears.indexOf(item) == pos;
    })
    console.log(filterYears)

    return (
        <div className="select-filter-container">
            <select className="select-filter">
                <option value="2022">{filterYears.releaseYear}</option>
            </select>
        </div>
    );
}

export default SortMovie;
